  ChangeSubQuantity(fieldName, fieldNameMain, index) {
    let x = parseInt(this.dynamicForm?.get(fieldName).value);
    let y = parseInt(this.dynamicForm?.get(fieldNameMain).value);
    console.log(fieldName, fieldNameMain);
    if (index == 0) {
      index = 0;
    } else {
      index = index / 2;
    }
    let unit = this.selected_row_data?.[index].store_qty;
    if (Number.isNaN(x) || Number.isNaN(y)) {
      x = 0;
      y = 0;
    }
    const regex = /\d/g;
    const str = x.toString();
    const matches = str.match(regex);
    if (x > 0 && x < unit) {
      this.dynamicForm?.get(fieldNameMain).setValue(-(unit - x));
    } else if (x == 0) {
      this.dynamicForm?.get(fieldNameMain).setValue(-unit);
    } else if (x == unit) {
      this.dynamicForm?.get(fieldNameMain).setValue(0);
    } else if (x < 0) {
      let result = unit + -x;
      console.log(result);
      this.dynamicForm?.get(fieldNameMain).setValue(-result);
    } else if (x > unit) {
      this.dynamicForm?.get(fieldNameMain).setValue(+(x - unit));
    }
  }
